import React from "react";
import { Container, Col, Row } from "react-bootstrap";
import "../styles/index.css";
import Post from "./Post";

export default function Posts({ posts }) {
  return (
    <div>
      {posts.map((p) => (
        <Post post={p} />
      ))}
    </div>
  );
}
